// /frontend/src/components/admin/SidebarAdmin.jsx
import React from 'react';
import { Nav } from 'react-bootstrap';
import { LinkContainer } from 'react-router-bootstrap';
import './SidebarAdmin.css';

const SidebarAdmin = () => {
    return (
        <div className="sidebar-wrapper">
            <Nav className="flex-column">
                <div className="sidebar-header">
                    Painel Admin
                </div>
                <LinkContainer to="/admin/dashboard">
                    <Nav.Link className="sidebar-link"><i className="bi bi-speedometer2 me-2"></i>Dashboard</Nav.Link>
                </LinkContainer>
                <LinkContainer to="/admin/lojas">
                    <Nav.Link className="sidebar-link"><i className="bi bi-shop me-2"></i>Lojas</Nav.Link>
                </LinkContainer>
                <LinkContainer to="/">
                    <Nav.Link className="sidebar-link mt-auto"><i className="bi bi-box-arrow-left me-2"></i>Ver Site</Nav.Link>
                </LinkContainer>
            </Nav>
        </div>
    );
};

export default SidebarAdmin;
